lockfileVersion: '9.0'

settings:
  autoInstallPeers: true
  excludeLinksFromLockfile: false

importers:

  .:
    dependencies:
      cbor2:
        specifier: file:..
        version: file:..

packages:

  cbor2@file:..:
    resolution: {directory: .., type: directory}
    name: cbor2
    engines: {node: '>=18'}

snapshots:

  cbor2@file:..: {}
